using namespace std;

class NumMatrix {
private:
    vector<vector<int>> matrix;
    
    int getSum(int r, int c) {
        return r < 0 || c < 0 ? 0 : matrix[r][c];
    }
public:
    NumMatrix(vector<vector<int>> m): matrix(m) {
        if (matrix.empty() || matrix[0].empty()) {
            return;
        }
        
        int row = matrix.size();
        int col = matrix[0].size();
        for (int i = 0; i < row; ++i) {
            for (int j = 0; j < col; ++j) {
                matrix[i][j] = getSum(i - 1, j) + getSum(i , j - 1) - getSum(i - 1, j - 1) + matrix[i][j];
            }
        }
    }
    
    int sumRegion(int r1, int c1, int r2, int c2) {
        // assume all inputs are valid
        return getSum(r2, c2) - getSum(r1 - 1, c2) - getSum(r2, c1 - 1) + getSum(r1 -1, c1 - 1);
    }
};

